  \"crescent-lake-national-wildlife-refuge-narrative-report-september-1-to-december-31-1961-7d980\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1961. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, mammals, raptors, fish, reptiles, and disease-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and wildfires. Resource management is outlined; topics
  include grazing, haying, and fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge participation, fishing, violations,
  and safety. Items of interest, N-R forms, and photographs are attached. A short
  narrative report of North Platte National Wildlife Refuge is included.\",\n\t\"license_title\":
